'use strict';

// MODULES //

var data = require( './../data/names.json' );


// FIRST NAMES //

/**
* Returns a list of common female first names in English speaking countries.
*
* @returns {StringArray} female first names
*
* @example
* var list = names();
* // returns [ 'Aaren', 'Aarika', 'Abagael', 'Abagail', 'Abbe', ... ]
*/
function names() {
	return data.slice();
} // end FUNCTION names()


// EXPORTS //

module.exports = names;
